import React, {Component} from "react";
import {Link} from "react-router-dom";

export default class InstrumentTableRow extends Component {    
    render() {
        return (
            <tr>
                <td>{this.props.instruments.type}</td>
                <td>{this.props.instruments.colour}</td>
                <td>{this.props.instruments.year}</td>
                <td>{this.props.instruments.price}</td>
                <td>
                    <Link className="green-button" to={"/EditInstrument/" + this.props.instruments._id}>Edit</Link>                    
                    <Link className="red-button" to={"/DeleteInstrument/" + this.props.instruments._id}>Delete</Link>   
                </td>
            </tr>
        );
    }
}
